import React, { useEffect, useRef, useState, useCallback } from "react";
import { useMap } from "react-leaflet";
import L from "leaflet";
import { createCustomIcon, createBrandLogo } from "../utils/iconHelpers";

const IconMarkersLayer = ({
  markers, // lista CON filtro EDS
  markersForMercado, // lista SIN filtro EDS para competencia
  selectedRegion,
  baseCompData,
  selectedEds, // ‚úÖ Recibir EDS seleccionado
}) => {
  const map = useMap();
  const markersRef = useRef({});
  const zoomUpdateRef = useRef(null);
  const [showingAssociated, setShowingAssociated] = useState(false);
  const [selectedPbl, setSelectedPbl] = useState(null); // ‚úÖ Guardar PBL al clickear

  const clearMarkers = useCallback(() => {
    if (!map) return;
    Object.values(markersRef.current).forEach((marker) => {
      try {
        if (map.hasLayer(marker)) map.removeLayer(marker);
      } catch {}
    });
    markersRef.current = {};
  }, [map]);

  const makeDraggable = useCallback((popup) => {
    if (!map || !popup || !popup.getElement) return;
    const el = popup.getElement();
    if (!el) return;
    try {
      const wrapper = el.querySelector(".leaflet-popup-content-wrapper");
      if (!wrapper) return;
      const draggable = new L.Draggable(el, wrapper);
      draggable.enable();
    } catch {}
  }, [map]);

  // ‚úÖ Obtener competencia del PBL seleccionado
  const competenciaFiltered = useCallback(() => {
    if (!selectedPbl || !Array.isArray(baseCompData)) return [];
    return baseCompData.filter(
      item => String(item.pbl).trim() === String(selectedPbl).trim()
    );
  }, [selectedPbl, baseCompData]);

  // ‚úÖ Renderizar marcadores de competencia si bot√≥n Mercado est√° activo
  const renderCompetenciaMarkers = useCallback(() => {
    if (!showingAssociated || !selectedPbl) return;

    const competencia = competenciaFiltered();
    console.log(`üìä Mostrando ${competencia.length} estaciones de competencia para PBL: ${selectedPbl}`);

    competencia.forEach((comp) => {
      const markerId = `comp-${comp.id || comp.eds}`;
      if (markersRef.current[markerId]) return; // Ya existe

      const lat = parseFloat(comp.latitud);
      const lng = parseFloat(comp.longitud);

      if (isNaN(lat) || isNaN(lng)) return;

      const leafletMarker = L.marker([lat, lng], {
        icon: createCustomIcon("Competencia"),
      });

      const popupContent = `
        <div class="popup-content">
          <strong>${comp.nombre || comp.eds}</strong><br/>
          Marca: ${comp.Marca || "Unknown"}<br/>
          PBL: ${comp.pbl}
        </div>
      `;

      leafletMarker.bindPopup(popupContent);
      leafletMarker.addTo(map);
      makeDraggable(leafletMarker.getPopup());
      markersRef.current[markerId] = leafletMarker;
    });
  }, [showingAssociated, selectedPbl, baseCompData, map, makeDraggable, competenciaFiltered]);

  // ‚úÖ Renderizar marcadores principales (CON filtro EDS)
  const renderMainMarkers = useCallback(() => {
    clearMarkers();
    setShowingAssociated(false);
    setSelectedPbl(null);

    if (!map || markers.length === 0) return;

    markers.forEach((marker) => {
      const markerId = `marker-${marker.id || marker.pbl}`;
      const lat = parseFloat(marker.lat);
      const lng = parseFloat(marker.lng);

      if (isNaN(lat) || isNaN(lng)) return;

      const leafletMarker = L.marker([lat, lng], {
        icon: createCustomIcon(marker.Marca),
      });

      const popupContent = `
        <div class="popup-content">
          <strong>${marker.nombre || marker.eds}</strong><br/>
          Regi√≥n: ${marker.Region}<br/>
          Comuna: ${marker.Comuna}<br/>
          Marca: ${marker.Marca}<br/>
          PBL: ${marker.pbl}<br/>
          <button 
            id="mercado-btn-${marker.id || marker.pbl}" 
            style="background: #007bff; color: white; border: none; padding: 8px 12px; border-radius: 4px; cursor: pointer; width: 100%; margin-top: 8px;"
          >
            Ver Competencia (Mercado)
          </button>
        </div>
      `;

      leafletMarker.bindPopup(popupContent);
      leafletMarker.addTo(map);
      makeDraggable(leafletMarker.getPopup());
      markersRef.current[markerId] = leafletMarker;

      // ‚úÖ Attach event listener al bot√≥n despu√©s de que el popup se abre
      leafletMarker.on("popupopen", () => {
        const btn = document.getElementById(`mercado-btn-${marker.id || marker.pbl}`);
        if (btn) {
          btn.addEventListener("click", () => {
            console.log(`üîç Bot√≥n clickeado para PBL: ${marker.pbl}`);
            setSelectedPbl(marker.pbl);
            setShowingAssociated(true);
          });
        }
      });
    });
  }, [markers, map, clearMarkers, makeDraggable]);

  // ‚úÖ Renderizar competencia cuando cambia showingAssociated o selectedPbl
  useEffect(() => {
    renderCompetenciaMarkers();
  }, [showingAssociated, selectedPbl, renderCompetenciaMarkers]);

  // ‚úÖ Renderizar marcadores principales al cambiar markers o selectedEds
  useEffect(() => {
    renderMainMarkers();
  }, [markers, selectedEds, renderMainMarkers]);

  return null;
};

export default IconMarkersLayer;
